    ,f_guardarRespuestasCuestionarioModel: function(arg_dataCollection,id_vacante_cuestionario){
        try{
            return $.ajax({
                url: BASE_URL+'solicitud-empleo/guardar-respuestas-cuestionario',
                type: "POST",
                data: {"data": arg_dataCollection,"id_vacante_cuestionario":id_vacante_cuestionario}
            });
        } catch (exception) {
            console.log(exception);
        }
    },finalizarProcesoSolicitudFilesModel: function(arg_dataCollection){
        try{
            return $.ajax({
                url: BASE_URL+'solicitud-empleo/finalizar-proceso-solicitud-archivos',
                type: "POST",
                cache: false,
                contentType: false,
                processData: false,
                data: arg_dataCollection
            });
        } catch (exception) {
            console.log(exception);
        }
    }
    ,finalizarProcesoSolicitudModel: function(arg_dataCollection){
        try{
            return $.ajax({
                url: BASE_URL+'solicitud-empleo/finalizar-proceso-solicitud',
                type: "POST",
                data: {"data": arg_dataCollection}
            });
        } catch (exception) {
            console.log(exception);
        }
    }
